import React, { useState, useEffect } from 'react';
import "./ControlPanelPage.css";

const timeframes = ["1 day", "1 week", "1 month", "1 year", "All time"];

const ControlPanelPage = () => {
  const [selectedTimeframe, setSelectedTimeframe] = useState(timeframes[0]);
  const [currentDate, setCurrentDate] = useState(""); // Состояние для текущей даты
  const [currentTime, setCurrentTime] = useState(""); // Состояние для текущего времени

  // Функция для обновления даты и времени каждую секунду
  useEffect(() => {
    const interval = setInterval(() => {
      const now = new Date();
      setCurrentDate(now.toLocaleDateString()); // Обновление даты
      setCurrentTime(now.toLocaleTimeString()); // Обновление времени
    }, 1000);

    // Очистка интервала при размонтировании компонента
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="control-panel">
      {/* Заголовок страницы и дата/время */}
      <div className="header">
        <h1>Control Panel</h1>
        <p className="date">{currentDate}</p> {/* Отображение даты */}
        <p className="time">{currentTime}</p> {/* Отображение времени */}
      </div>
      <hr className="divider" />
      
      {/* Выбор временного промежутка */}
      <div className="time-frame">
        <label>Timeframe: </label>
        <select 
          value={selectedTimeframe} 
          onChange={(e) => setSelectedTimeframe(e.target.value)}
        >
          {timeframes.map((time, index) => (
            <option key={index} value={time}>{time}</option>
          ))}
        </select>
      </div>
      
      {/* Блок Revenue */}
      <div className="revenue">
        <div className="stats">
          {["Money spent", "Revenue", "Working containers", "KWh for spent money", "System efficiency", "Today KWh"].map((item, index) => (
            <div className="stat-box" key={index}>
              <p className="stat-title">{item}</p>
              <p className="stat-value">{["5000€", "12000€", "35", "2500 KWh", "85%", "450 KWh"][index]}</p>
            </div>
          ))}
        </div>
        <div className="chart">
          <p>График (тут будет график)</p>
        </div>
      </div>
      
      {/* Container Status */}
      <div className="container-status">
        <h2>Container Status</h2>
        <table>
          <thead>
            <tr>
              <th>No.</th>
              <th>Serial No.</th>
              <th>Place</th>
              <th>Status</th>
              <th>Earning</th>
              <th>More</th>
            </tr>
          </thead>
          <tbody>
            {[ 
              ["01", "64123", "50.881899, 3.967258", "Repairing", "€18,492.15"],
              ["02", "64124", "50.881500, 3.967300", "Active", "€22,300.00"],
              ["03", "64125", "50.882000, 3.967500", "Repairing", "€15,100.75"],
              ["04", "64126", "50.882200, 3.967700", "Active", "€19,800.90"],
              ["05", "64127", "50.882500, 3.967900", "Active", "€25,000.50"]
            ].map((data, index) => (
              <tr key={index}>
                {data.map((value, i) => <td key={i}>{value}</td>)}
                <td><button>Details</button></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      
      {/* PNL */}
      <div className="pnl">
        <div className="chart-placeholder">График 1</div>
        <div className="chart-placeholder">График 2</div>
      </div>
    </div>
  );
};

export default ControlPanelPage;
